/*Table structure for table `loaikhoahoc` */

DROP TABLE IF EXISTS `loaikhoahoc`;

CREATE TABLE `loaikhoahoc` (
  `MaLoaiKhoaHoc` char(10) character set utf8 collate utf8_unicode_ci NOT NULL,
  `TenLoaiKhoaHoc` char(50) NOT NULL,
  `MaNienKhoa` char(5) NOT NULL,
  PRIMARY KEY  (`MaLoaiKhoaHoc`),
  KEY `FK_loaikhoahoc_nienkhoa` (`MaNienKhoa`),
  CONSTRAINT `FK_loaikhoahoc_nienkhoa` FOREIGN KEY (`MaNienKhoa`) REFERENCES `nienkhoa` (`MaNienKhoa`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `loaikhoahoc` */

insert  into `loaikhoahoc`(`MaLoaiKhoaHoc`,`TenLoaiKhoaHoc`,`MaNienKhoa`) values ('mlkh10001','Android','100'),('mlkh9901','Window','100');

/*Table structure for table `lophoc` */

DROP TABLE IF EXISTS `lophoc`;

CREATE TABLE `lophoc` (
  `MaLop` char(10) collate utf8_unicode_ci NOT NULL,
  `NgayHoc` date NOT NULL,
  `Phong` int(11) NOT NULL,
  `SoHocVien` int(11) NOT NULL,
  `TenMonHoc` varchar(50) collate utf8_unicode_ci NOT NULL,
  `LichHoc` varchar(50) collate utf8_unicode_ci NOT NULL,
  `MaKhoa` char(10) collate utf8_unicode_ci NOT NULL,
  `GiangVien` char(10) collate utf8_unicode_ci default NULL,
  PRIMARY KEY  (`MaLop`),
  KEY `FK_lophoc` (`MaKhoa`),
  KEY `FK_lophoc_giangvien` (`GiangVien`),
  CONSTRAINT `FK_lophoc_giangvien` FOREIGN KEY (`GiangVien`) REFERENCES `giangvien` (`MaGiangVien`) ON UPDATE SET NULL,
  CONSTRAINT `FK_lophoc_khoahoc` FOREIGN KEY (`MaKhoa`) REFERENCES `khoahoc` (`MaKhoaHoc`)
